import * as THREE from 'three';

function createRod(cartesian){
    const verticies = new Float32Array([0,0,0,cartesian['x'], cartesian['y'], cartesian['z']])
    const LineMaterial = new THREE.LineBasicMaterial( { color: 'white' } );
    const lineGeometry = new THREE.BufferGeometry(verticies, 3)

    const line = new THREE.Line( lineGeometry, LineMaterial );


    return [verticies, line]
}

export { createRod };
